import "./Header.css";
import React from "react";

export default function Header() {
    return (
        <header className="landing-header">
            <p>Title</p>
            <ul className="header-link">
                <li>Introduction</li>
                <li>Service</li>
                <li>Contact</li>
            </ul>
        </header>
    );
}
